import React from 'react';

const OrganizarCostesPage = () => {
  return (
    <div className="container mt-5">
      <h1>Organización de Costes</h1>
      <p>Aquí puedes gestionar todos los costos relacionados con tus envíos.</p>
    </div>
  );
};

export default OrganizarCostesPage;
